import React, { Component } from "react";
import { Link } from "react-router-dom";
class NavProd extends Component {
  render() {
    let Options = ["View","Add"];
    return (
      <nav className="navbar navbar-expand-sm navbar-dark bg-dark">
        <Link className="navbar-brand" to="/">
          ProductPortal
        </Link>
        <div className="">
          <ul className="navbar-nav mr-auto">
            <li className="nav-item">
            <a className="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-bs-toggle="dropdown">
                Shops
              </a>
              <div className="dropdown-menu">
                {Options.map((n1) => (
                  <Link key={n1} className="dropdown-item" to={`/shops/${n1}`}>
                    {n1}
                  </Link>
                ))}
              </div>
            </li>
            <li className="nav-item dropdown">
            <a className="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-bs-toggle="dropdown">
                Products
              </a>
              <div className="dropdown-menu">
                {Options.map((n1) => (
                  <Link key={n1} className="dropdown-item" to={`/products/${n1}`}>
                    {n1}
                  </Link>
                ))}
              </div>
              </li>
            <li className="nav-item">
              <Link className="nav-link" to="/purchases">
                Purchases
              </Link>
            </li>
          </ul>
        </div>
      </nav>
    );
  }
}
export default NavProd;
